int DashGpencilModifierData_segments_lookup_int(PointerRNA *ptr, int index, PointerRNA *r_ptr)
{
    int found = 0;
    CollectionPropertyIterator iter;

    DashGpencilModifierData_segments_begin(&iter, ptr);

    if (iter.valid) {
        ArrayIterator *internal = &iter.internal.array;
        if (index < 0 || index >= internal->length) {
#ifdef __GNUC__
            printf("Array iterator out of range: %s (index %d)\n", __func__, index);
#else
            printf("Array iterator out of range: (index %d)\n", index);
#endif
        }
        else if (internal->skip) {
            while (index-- > 0 && iter.valid) {
                rna_iterator_array_next(&iter);
            }
            found = (index == -1 && iter.valid);
        }
        else {
            internal->ptr += internal->itemsize * index;
            found = 1;
        }
        if (found) { *r_ptr = DashGpencilModifierData_segments_get(&iter); }
    }

    DashGpencilModifierData_segments_end(&iter);

    return found;
}

int DashGpencilModifierData_segments_lookup_string(PointerRNA *ptr, const char *key, PointerRNA *r_ptr)
{
    extern int DashGpencilModifierSegment_name_length(PointerRNA *);
    extern void DashGpencilModifierSegment_name_get(PointerRNA *, char *);

    bool found = false;
    CollectionPropertyIterator iter;
    char namebuf[1024];
    char *name;

    DashGpencilModifierData_segments_begin(&iter, ptr);

    while (iter.valid) {
        if (iter.ptr.data) {
            int namelen = DashGpencilModifierSegment_name_length(&iter.ptr);
            if (namelen < 1024) {
                DashGpencilModifierSegment_name_get(&iter.ptr, namebuf);
                if (strcmp(namebuf, key) == 0) {
                    found = true;
                    *r_ptr = iter.ptr;
                    break;
                }
            }
            else {
                name = MEM_mallocN(namelen+1, "name string");
                DashGpencilModifierSegment_name_get(&iter.ptr, name);
                if (strcmp(name, key) == 0) {
                    MEM_freeN(name);

                    found = true;
                    *r_ptr = iter.ptr;
                    break;
                }
                else {
                    MEM_freeN(name);
                }
            }
        }
        DashGpencilModifierData_segments_next(&iter);
    }
    DashGpencilModifierData_segments_end(&iter);

    return found;
}

